import React from 'react';
import fruitsImage from '../public/fruits.jpg';  // ✅ Import image

const HomePage = () => {
  return (
    <div 
      className="homepage"
      style={{ backgroundImage: `url(${fruitsImage})` }}  // ✅ Use dynamic import
    >
      <h1>Welcome to the Home Page</h1>
    </div>
  );
};

export default HomePage;
